import React from 'react';
import { Container, CssBaseline } from '@mui/material';
import StoryBar from './';

const App = () => {
  const stories = [
    { imageUrl: 'url1.jpg', unread: true },
    { imageUrl: 'url2.jpg', unread: false },
    // Add more story objects as needed
  ];

  return (
    <div className="app">
      <CssBaseline />
      <Container maxWidth="lg">
        {/* Other app content */}
        <StoryBar stories={stories} />
      </Container>
    </div>
  );
};

export default App;
